let activepage=()=>{let e=`${location.pathname.split("/").slice(-1)}-tab`,t=(document.getElementById(e),document.getElementsByClassName("active"));for(let e=0;e<t.length;e++)t[e].className-=" active";document.getElementById(e).className+=" active"},toggleQuoteRow=e=>{let t=`quote-row-${e.slice(-1)}`,a=document.getElementById(t);"hidden"==a.className?a.className="show":a.className="hidden"};